import React from "react";
import HeadCell from "./HeadCell/index";

const TableHead = ({ matrix }) => {
   const matrixHeads = matrix.map((item, index) => {
      return <HeadCell key={index} value={"col " + (index + 1)} />;
   });
   let defaultHeads = [
      <HeadCell key="empty" value="" />,
      <HeadCell key="sum" value={"Sum"} />,
   ];
   const heads = defaultHeads
      .slice(0, 1)
      .concat(matrixHeads)
      .concat(defaultHeads.slice(1));

   return (
      <thead>
         <tr>{heads}</tr>
      </thead>
   );
};

export default TableHead;
